import{_ as i,c as a,a3 as t,o}from"./chunks/framework.uL7cFZ_M.js";const u=JSON.parse('{"title":"Copycat Chick-fil-A Spicy Southwest Salad","description":"","frontmatter":{"tags":["recipe"],"created":"2023-07-10T06:00:00.000Z","author":null,"source":"https://realhousemoms.com/copycat-chick-fil-a-spicy-southwest-salad/","title":"Copycat Chick-fil-A Spicy Southwest Salad","type":"Recipe","topic":["Food"]},"headers":[],"relativePath":"recipes/food/spicy-southwest-salad.md","filePath":"recipes/food/spicy-southwest-salad.md","lastUpdated":null}'),l={name:"recipes/food/spicy-southwest-salad.md"};function s(n,e,r,c,d,h){return o(),a("div",null,e[0]||(e[0]=[t('<h1 id="copycat-chick-fil-a-spicy-southwest-salad" tabindex="-1">Copycat Chick-fil-A Spicy Southwest Salad <a class="header-anchor" href="#copycat-chick-fil-a-spicy-southwest-salad" aria-label="Permalink to &quot;Copycat Chick-fil-A Spicy Southwest Salad&quot;">​</a></h1><p>One bite of this Copycat Chick-fil-A Spicy Southwest Salad with seasoned chicken, fresh produce &amp; creamy salsa dressing will have you hooked!</p><p><img src="https://realhousemoms.com/wp-content/uploads/Copycat-Chick-Fil-A-Spicy-Southwest-Salad-RECIPE-CARD.jpg" alt="Copycat Chick-fil-A Spicy Southwest Salad"></p><h3 id="ingredients" tabindex="-1">Ingredients <a class="header-anchor" href="#ingredients" aria-label="Permalink to &quot;Ingredients&quot;">​</a></h3><ul><li>2 boneless skinless chicken breasts</li><li>2 tablespoons extra virgin olive oil</li><li>2 tablespoons lime juice</li><li>4 stems cilantro</li><li>3 teaspoons garlic (minced)</li><li>1 teaspoon cumin seeds ((or 1/2 teaspoon ground cumin)</li><li>1/2 teaspoon smoked paprika</li><li>1/2 teaspoon garlic powder</li><li>1/2 teaspoon chili powder</li><li>1/2 teaspoon dried parsley</li><li>1/4 teaspoon onion powder</li><li>1/4 teaspoon ground cumin</li><li>1 ear corn</li><li>1 pint grape tomatoes (halved)</li><li>2 poblano peppers (seeded and chopped)</li><li>1 red bell pepper (seeded and chopped)</li><li>15 ounces canned black beans (drained and rinsed)</li><li>3 cups mixed greens</li><li>3 ounces Monterey Jack cheese (shredded)</li><li>3 ounces cheddar cheese (shredded)</li><li>1 cup tortilla strips</li><li>1/4 cup chili lime pepitas ((see note))</li><li>1/2 cup salsa</li><li>1/4 cup mayonnaise</li><li>1/4 cup sour cream</li><li>2 tablespoons lime juice</li><li>1 teaspoon ground cumin</li><li>1/2 teaspoon salt</li><li>1/2 teaspoon pepper</li></ul><h3 id="instructions" tabindex="-1">Instructions <a class="header-anchor" href="#instructions" aria-label="Permalink to &quot;Instructions&quot;">​</a></h3><ul><li>Put the chicken breasts into a gallon-size ziplock bag. Add the olive oil, lime juice, cilantro, garlic, and cumin seeds to the bag. Seal and smush around the chicken. Marinate for 1 hour.</li><li>While the chicken is marinating, make the dressing by adding the dressing ingredients to a food processor or blender. Cover and purée. Pour it into a sealable container and refrigerate until ready to serve.</li><li>Place a large skillet over high heat. Brush the corn with olive oil and season with a pinch of salt and pepper. Roast for 2 minutes per side. Then use a knife to cut the corn kernels off the cob. Set aside.</li><li>Add the tomatoes, poblano, and bell pepper to the skillet and sauté for 5 minutes. Stir in the corn kernels and sauté for another 2 minutes.</li><li>Add lettuce, tomato, bell pepper, poblano, corn, black beans, and shredded cheese to a large salad bowl and toss. (You can also make the salad in individual bowls, just divide the ingredients evenly between them.)</li><li>Place a grill pan or cast iron skillet over high heat. Stir together the chicken seasoning ingredients in a small bowl.</li><li>Remove the chicken from the marinade. Season both sides of each breast with seasoning. Place the chicken between 2 sheets of plastic wrap and pound them to ½-inch thick using a meat mallet (or a rolling pin).</li><li>Lightly spray the grill pan with nonstick cooking spray. Place chicken into the pan and cook for 5 minutes per side. Transfer the chicken to a cutting board and cut it into thin slices.</li><li>Place the chicken slices on top of the salad. Garnish with the tortilla strips and pepitas. Drizzle with dressing or serve it on the side.</li></ul><hr><h2 id="notes" tabindex="-1">Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;Notes&quot;">​</a></h2>',9)]))}const m=i(l,[["render",s]]);export{u as __pageData,m as default};
